function InputField() {
  return (
    <div className="flex flex-col text-sm">
      <label className="mb-1">
        Username
      </label>
      <div className="relative flex items-center">
        <input type="text" className="rounded text-sm border-red-300 focus:ring-red-500 focus:border-red-500"/>
        <svg className="absolute right-0 h-5 w-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z"/>
        </svg>
      </div>
      <label className="mt-2 text-red-600">
        This username has already been taken.
      </label>
    </div>
  );
}

export default InputField;
